import React from "react";

function Header() {
  return (
    <svg
      id="header"
      width="1920"
      height="80"
      viewBox="0 0 1920 80"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <rect width="1920" height="80" fill="white" />
    </svg>
  );
}

export default Header;
